const App = () => {
  //Set state for rendering comments //remember to import it

  return (
    <div>
      <UserProvider>
        <Header />
        <Route path="/">
          <About />
        </Route>
        <Route path="/Forum">
          <Forum />
        </Route>
        <Route path="/CompanyForum">
          <Forum from="company" />
        </Route>
        <Route path="/LocationForum">
          <Forum from="location" />
        </Route>
        <Route path="/SignIn">
          <SignIn />
        </Route>
        <Route path="/SignUp">
          <SignUp />
        </Route>
        <Route path="/Dashboard">
          <Dashboard />
        </Route>
      </UserProvider>
    </div>
  );
};

export default App;
